import Head from 'next/head'
import Layout, { siteTitle } from '../components/layout'


import AboutContainer from '../components/aboutContainer/aboutContainer'

import styles from '../styles/page_styles/project.module.scss'
import React from 'react'
import TimeLine from '../components/aboutContainer/timeLine'
import ResponsiveComponent from '../components/responsiveComponent/responsive';
import DesNav from '../components/navBar/NavBar';
import GithubLink from "../components/profile_link/github_link";
//import ImageCarousel from "../components/carousel"
import AwesomeSlider from 'react-awesome-slider';
import AwsSliderStyles from '../styles/page_styles/styles.module.scss';
import process, { browser } from 'process'

const pageTitle:string = siteTitle+ " - projects";

export default function Home({
  allPostsData
}: {
  allPostsData: {
    date: string
    title: string
    id: string
  }[]
}) {
  return (

    <div>

      <Head>

        <title>{pageTitle}</title>

      </Head>
      <DesNav/>
      <div className={styles.projectContainer}>dd
      {slider}
      </div>
      
    </div>
  )
}

if(process.browser){
  window.innerWidth
  window.innerHeight
}

const slider =(
  <AwesomeSlider cssModule={AwsSliderStyles} className={styles.aws_btn} 
  >
    <div style={{height:"100%",width:"100vw",background:"url('/images/IMG_6812.jpg')",backgroundSize:"cover",backgroundPosition:"60% 0%"}}>
    <a href='/about' className={styles.homeButton}>about me</a>
    </div>
    <div style={{height:"100%",width:"100vw",background:"url('/images/IMG_6812.jpg')",backgroundSize:"cover",backgroundPosition:"60% 0%"}}></div>
    <div style={{height:"100%",width:"100vw",background:"url('/images/IMG_6812.jpg')",backgroundSize:"cover",backgroundPosition:"60% 0%"}}></div>
  </AwesomeSlider>
);
